package JumpingStatement;

public class jumpingStatementDemo2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		for(int a = 1; a <= 10; a++)
		{
			
			if(a == 3 || a == 5 || a==7)//
			
			{
				//continue;
				break;//will stop the program
			}
			
			System.out.println(a);
		}

	}

}
